import MainApp from "../components/layouts/MainApp";
import CardProduct from "../components/molecules/Card/CardProduct";

export default function Home() {
  return (
    <MainApp>
      <Container>
        <div>
          <h2>List Product</h2>
        </div>
        <CardProduct />
      </Container>
    </MainApp>
  )
}
